<div class="modal fade" id="modelId" tabindex="-1" role="dialog" aria-labelledby="modelTitleId" aria-hidden="true">
  <div class="modal-dialog" role="document">
    <div class="modal-content">
      <div class="modal-header">
        <h5 class="modal-title">Error</h5>
        <button type="button" class="close" data-dismiss="modal" aria-label="Close">
          <span aria-hidden="true">&times;</span>
        </button>
      </div>
      <div class="modal-body">
        Select Both Dest and Source to Continue
      </div>
      <div class="modal-footer">
        <button type="button" class="btn btn-danger" data-dismiss="modal">Close</button>
      </div>
    </div>
  </div>
</div>
<div class="modal fade" id="modalFailure" tabindex="-1" role="dialog" aria-labelledby="modelTitleId" aria-hidden="true">
  <div class="modal-dialog" role="document">
    <div class="modal-content">
      <div class="modal-header">
        <h5 class="modal-title">Error</h5>
        <button type="button" class="close" data-dismiss="modal" aria-label="Close">
          <span aria-hidden="true">&times;</span>
        </button>
      </div>
      <div class="modal-body">
        Failed to find Path
      </div>
      <div class="modal-footer">
        <button type="button" class="btn btn-danger" data-dismiss="modal">Close</button>
      </div>
    </div>
  </div>
</div>
<nav class="navbar navbar-expand-sm navbar-dark bg-dark">
  <a class="navbar-brand" href="#">BFS Visualizer</a>
  <button class="navbar-toggler d-lg-none" type="button" data-toggle="collapse" data-target="#collapsibleNavId"
          aria-controls="collapsibleNavId"
          aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>
  <div class="collapse navbar-collapse" id="collapsibleNavId">
    <ul class="navbar-nav mr-auto mt-2 mt-lg-0">
      <li id="option-algo" class="nav-item dropdown">
        <a #algoLabel class="nav-link dropdown-toggle" href="#" id="algoId" data-toggle="dropdown" aria-haspopup="true"
           aria-expanded="false">BFS</a>
        <div class="dropdown-menu" aria-labelledby="algoId">
          <a class="dropdown-item" href="#" (click)="algoChange('BFS'); algoLabel.innerHTML = 'BFS'" value="BFS">BFS</a>
          <a class="dropdown-item" href="#" (click)="algoChange('DFS'); algoLabel.innerHTML = 'DFS'" value="DFS">DFS</a>
        </div>
      </li>
      <li id="options-dropdown" class="nav-item dropdown">
        <a class="nav-link dropdown-toggle" href="#" id="dropdownId" data-toggle="dropdown" aria-haspopup="true"
           aria-expanded="false">Select Source/Dest</a>
        <div class="dropdown-menu" aria-labelledby="dropdownId">
          <a class="dropdown-item" href="#" value="Source">Source</a>
          <a class="dropdown-item" href="#" value="Destination">Destination</a>
        </div>
      </li>
      <li id="options-speed" class="nav-item dropdown">
        <a class="nav-link dropdown-toggle" href="#" id="speedId" data-toggle="dropdown" aria-haspopup="true"
           aria-expanded="false">Normal Speed</a>
        <div class="dropdown-menu" aria-labelledby="speedId">
          <a class="dropdown-item" href="#" value="Slow">Slow</a>
          <a class="dropdown-item" href="#" value="Normal">Normal</a>
          <a class="dropdown-item" href="#" value="Fast">Fast</a>
        </div>
      </li>
      <li class="nav-item">
        <div class="form-check mt-2 ml-3">
          <label class="form-check-label">
            <input #wallsMode (click)="checkWall(wallsMode.checked)" type="checkbox" class="form-check-input"
                   [defaultChecked]="false" name="" id="" value="checkedValue" checked>
            <p class="text-white">Walls Mode</p>
          </label>
        </div>
      </li>

      <li class="nav-item">
        <div class="form-check mt-2 ml-3">
          <label class="form-check-label ">
            <input #diagnoalMode (change)="onDiagonalModeClicked(diagnoalMode.checked)" type="checkbox"
                   class="form-check-input" [defaultChecked]="false" value="checkedValue">
            <p class="text-white">Allow Diagonal Steps</p>
          </label>
        </div>
      </li>
    </ul>
    <form class="form-inline my-2 my-lg-0">
      <button id="reset-btn" class="btn btn-danger my-2 my-sm-0 mr-2" type="submit">Reset</button>
      <button id="search-btn" class="btn btn-primary my-2 my-sm-0 mr-2" type="submit">Search</button>
      <button #genRandom id="generate-btn" (click)="generateRandomObstacles($event,100)" class="btn btn-secondary my-2 my-sm-0" type="submit">Random Obstacles</button>
    </form>
  </div>
</nav>
